import React from 'react';
import Postlist from './Postlist';
import { BrowserRouter as Router, Route } from "react-router-dom";
import './App.css';



function App() {


  function About() {
  return <h2>About</h2>;
}

function Users() {
  return <h2>Users</h2>;
}

  return (
    <div className="App">
      <Router>
        <Route path="/"  component={Postlist} />
      </Router>
    </div>
  );
}


export default App;
